import React, { Component } from 'react';

class List extends Component {

  static defaultProps = {
    data: []
  }

  constructor(props) {
    super(props);
    this.state = {
      showList: this.props.data,
    }
  }

  render() {
    return (
      <div className="todoList_wrap">
        {/* { list } */}
        { this.props.listItem }
      </div>
    );
  }
}

export default List;
